const paths = {
  "Salle de conférence":  {
    etage : -1,
    trace :
          [
            {x: 10, y: 20},
		        {x: 30, y: 50},
		        {x: 42, y: 78},
		        {x: 90, y: 50}
          ],
    steps: ["", "", "", ""]
  },
  "Salle du conseil municipal": {
    etage : 2,
    trace :
          [
            {x: 20, y:45},
            {x: 20, y:45}
          ],
    steps: ["", "", "", ""]
  }
};


export default paths;
